import { FabBars, FaTimes } from "react-icons/fa"

function Navbar() {
    return (
        <header>
            <h3>Logo</h3>
            <nav>
                <a href='/about'>About</a>
                <a href='/resorts'>Resorts</a>
                <button>
                    <FaBars />
                </button>
            </nav>
        </header>
    )
};

export default Navbar;
